    self.addEventListener("message", e => {/* eslint-disable-line no-restricted-globals */
        if(!e || (e.data[0] instanceof Array)){
            return;
        }
        const peaks = e.data[0]

        console.log("in send back peaks")
        postMessage([peaks]);
    })
}
